import React from 'react'
import styled from 'styled-components'

const Image = styled.div`
  background-color: white;
  height: 208px;
`

const Title = styled.h1`
  font-size: 24px;
  margin: 0 0 8px 0;
`

const Container = styled.div`
  background-color: #010409;
  border-radius: 8px;
  width: 224px;
  color: white;
  padding: 24px 16px;
`

const Card = () => {
  return (
    <Container>
      <Title>EMF 5</Title>
      <Image />
      <Title>Espiritu</Title>
    </Container>
  )
}

export default Card
